INSERT INTO `doginfo` VALUES (1,'โกลเด้น รีทรีฟเวอร์ (Golden retriever)','โกลเด้น รีทรีฟเวอร์ มีถิ่นกำเนิดในประเทศอังกฤษและสก๊อตแลนด์ โดยมีการบันทึกไว้ในช่วงทศวรรษที่  1860   ซึ่งบันทึกไว้ว่าได้มีคณะละครสัตว์ของรัฐเซีย   ได้นำฝูง สุนัข มาแสดง จนทำให้ท่านลอร์ด  ทวีดมัธ  ( Lord  Tweedmouth ) รู้สึกประทับใจ จึงได้ทำการขอซื้อไว้แล้วนำมาผสมพันธุ์หลายชั่วอายุ  จึงได้สายพันธุ์ โกลเด้น รีทรีฟเวอร์ ในที่สุด แต่การนำมาผสมกับสายพันธุ์ไหนนั้นยังไม่มีหลักฐานสรุปที่แน่นอน  แต่มีการสันนิษฐานว่า โกลเด้น มีสายเลือดผสมระหว่างสุนัขพันธุ์ Yellow Flat-Coated Retriever และ Light-Coated Tweed Water Spaniels และอาจจะมีสายพันธุ์ของ Newfoundland หรือ Bloodhound ผสมอยู่ด้วย ','โกลเด้น รีทรีฟเวอร์ เป็น สุนัข ที่มีความเชี่ยวชาญทางน้ำ โดยแต่เดิมเป็น สุนัข ที่ใช้ในกีฬาล่าสัตว์ นายพรานจะใช้ โกลเด้น ไปเก็บเป็ดน้ำที่ยิงได้กลับมา เนื่องจากมีประสาทสัมผัสดีเลิศทั้งในด้านของการฟังเสียง การดมกลิ่นสะกดรอย นอกจากนี้ โกลเด้น ยังมีสายตาอันเฉียบคมและแม่นยำ ด้วยเหตุนี้วงการทหารและตำรวจในหลายๆ ประเทศจึงได้นำ สุนัขพันธุ์โกลเด้น นี้มาฝึกเพื่อไว้ช่วยงานราชการ อาทิเช่น ตรวจค้นยาเสพติด, ดมกลิ่นสะกดรอยคนร้าย, ยามรักษาความปลอดภัย แต่ที่ดูเหมือนจะได้รับความนิยมสูงสุด ก็เห็นจะได้แก่ฝึกให้เป็น สุนัข นำทางคนตาบอด ทั้งนี้เพราะ โกลเด้น รีทรีฟเวอร์ เป็นสุนัขฉลาด และสุภาพ','นิสัยที่เป็นจุดเด่นของสายพันธุ์โกลเด้น รีทรีฟเวอร์ และถูกระบุไว้ในมาตรฐานคือ “มีความใจดี เป็นมิตรและไว้ใจได้” โกลเด้น รีทรีฟเวอร์ มักจะเป็นมิตรกับทั้งคนแปลกหน้าและคนที่คุ้นเคย ด้วยนิสัยที่สุภาพและเชื่อใจ จึงทำหน้าที่เป็นยามได้ไม่ดีนัก  ในขณะที่การเเสดงอาการก้าวร้าวอย่างไม่มีเหตุผล หรือการต่อต้านต่อผู้คน สุนัข หรือสัตว์อื่น ๆ ไม่ว่าจะในรูปแบบใด เป็นนิสัยที่ไม่เป็นที่ยอมรับนักในโกลเด้น รีทรีฟเวอร์ และไม่สอดคล้องกับลักษณะของสายพันธุ์ จนถือว่าเป็นความบกพร่อง เพราะโดยทั่วไปโกลเด้น รีทรีฟเวอร์ จะใจเย็น มีความฉลาดตามธรรมชาติ เชื่อฟัง และมีความกระตือรือร้น','มีความสูงประมาณ 21 - 24 นิ้ว และมีน้ำหนักอยู่ที่ 25 – 35 กิโลกรัม ','หูควรสั้นพอประมาณ ใบหูมีลักษณะห้อยปกลงแนบกับส่วนแก้ม รูปทรงค่อนไปทางรูปสามเหลี่ยม ปลายมน','ร่างกายกำยำสมส่วน ขนชั้นนอกยาวมีความนุ่มและมันวาว ขนชั้นในมีสีอ่อนกว่าขนชั้นนอก','ควรตั้งอยู่ในตำแหน่งสูงสุดต่อจากเส้นหลัง หางมีขนาดใหญ่โดยเฉพาะบริเวณโคนหางควรจะมีกล้ามเนื้อ','ขนดกแน่น สามารถปกป้องน้ำได้เป็นอย่างดี ขนมี 2 ชั้น ขนชั้นนอกจะยาวและมีลักษณะค่อนข้างแข็ง เส้นขนมีความยืดหยุ่นในตัว สำหรับขนบริเวณด้านหลังของขาและใต้ท้องจะมีลักษณะค่อนข้างอ่อนนุ่มกว่าขนตามลำตัว','สีต้องเป็นสีน้ำตาลออกทอง ส่วนจะมีสีเข้มอ่อนไม่มีปัญหา ขนตามใบหน้าและลำตัวอาจจะมีเหลือบเทาหรือขาวก็ได้ แต่ถ้าเป็นรอยแต้มด่างสีขาว หรือมีขนสีขาวขึ้นแซมถือเป็นข้อบกพร่อง','โกลเด้นฯ เป็นสุนัขที่มีขนร่วงมาก จำเป็นจะต้องแปรงและหวีขนให้มันสัปดาห์ละหลายๆ ครั้ง เพื่อป้องกันขนพันกัน การแปรงขนบ่อยๆ จะทำให้โกลเด้นฯ ดูสวยได้ ผู้เลี้ยงควรดูแลเรื่องเห็บ หมัด การระคายเคืองที่ผิวหนัง ขณะที่ทำการแปรงขน','อาบน้ำ 1 ครั้งต่อ 2 สัปดาห์','ควรแปรงขนให้สัปดาห์ละ 1-2 ครั้ง','ควรออกกำลังกายทุกวันอย่างน้อยวันละ 40-60 นาที ระมัดระวังการออกกำลังกายอย่างหนักที่มีการกระโดดเยอะ ๆ อย่างต่อเนื่องอาจทำให้เกิดความเสียหายต่อกระดูกและข้อต่อของสุนัขได้','เป็นผู้รักสัตว์','Medium','Long','Drop','','http://35.187.253.40/images/golden/cut.jpg'),(2,'ลาบราเดอร์ รีทรีฟเวอร์ (Labrador Retriver)','ลาบราดอร์ริทรีฟเวอร์มีต้นตระกูลอยู่ที่รัฐนิวฟันด์แลนด์และแลบราดอร์ ชายฝั่งทะเลของประเทศแคนาดา และในช่วงต้นศตวรรษที่ 19 ได้มีการนำสุนัขพันธุ์นี้ไปยังสหราชอาณาจักรทางเรือประมง และต่อมาก็ได้มีการพัฒนาสายพันธุ์และเลี้ยงขึ้นมาในฐานะสุนัขล่าเหยื่อ และยังถูกใช้เป็นสุนัขกู้ภัย เพราะสามารถเคลื่อนที่ได้เร็วแม้ในภูมิประเทศที่ขรุขระหรือแม้กระทั่งพื้นที่ที่ปกคลุมด้วยน้ำแข็ง แลบราดอร์ริทรีฟเวอร์เป็นที่รู้จักกันดีในเรื่องความอดทน เข้มแข็ง มีความสามารถในการดมกลิ่นที่ดีเยี่ยม ชอบเอาใจผู้อื่น และชอบเล่นกับเจ้าของมาก','สุนัขพันธุ์ลาบราดอร์ รีทรีฟเวอร์ในปัจจุบัน นับได้ว่าเป็นสุนัขพันธุ์ที่มีความสามารถ สามารถเลี้ยงไว้เพื่อใช้ล่าสัตว์ อีกทั้งยังสามารถใช้พวกมันปฏิบัติการพิเศษ ในการตรวจค้นหายาเสพติด หรือทำการค้นหาระเบิด ตลอดจนกระทั่งสามารถช่วยนำทางให้กับผู้พิการทางสายตาได้อีกด้วย','ลาบราดอร์ขึ้นชื่อในเรื่องของความฉลาดหลักแหลม เป็นมิตร และนิสัยดี ขี้ประจบเอาใจทั้งคนและสัตว์เลี้ยงตัวอื่น ๆ แต่เมื่อโตเต็มวัยพวกมันก็ยังคงมีความขี้เล่น มีความกระตือรือร้น และมีความอดทนสูงต่อการฝึกฝน เรียนรู้เร็ว มีสมาธิกับงาน หรือกิจกรรมที่มันทำอย่างมาก จึงไม่แปลกใจเลยพวกมันมักถูกเลือกให้เป็นสุนัขตำรวจ หรือสุนัขช่วยเหลือผู้พิการทางสายตา เพราะเป็นสุนัขที่มีสมาธิดีมาก ๆ ชอบที่ได้รับคำชื่นชมจากเจ้าของ นอกจากนี้ ลาบราดอร์ยังถือว่าเป็นสุนัขบำบัดที่ดีเนื่องจากมีความเด่นชัดในด้านพลังบวก','ตัวผู้สูง 22.5-24.5 นิ้ว หนัก 60-75 ปอนด์ ตัวเมียสูง 21.5-23.5 นิ้ว น้ำหนัก 55-70 ปอนด์ (ส่วนสูงถึงหัวไหล่ และน้ำหนักโดยประมาณ 25-34 กิโลกรัม)','หูจะปรกด้านข้างของหัว มีขนาดพอดี ถ้าดึงปลายหูมาด้านหน้าจะยาวระดับตา','คอยาวเล็กน้อย มีกล้ามเนื้อที่แข็งแรงเป็นลักษณะของสุนัขที่ใช้ในเกมกีฬา เส้นหลังตรง ลำตัวสั้น ช่วงอกกว้างหนา กระดูกซี่โครงค่อนข้างกลม','ส่วนโคนหางมีขนาดใหญ่ กลม หนา เรียวไปยังส่วนปลาย ไม่มีพู่หาง หางคล้ายหางของนาก','ขนสั้น เหยียดตรงและหนา มีขนสองชั้น ขนเรียบ มีสามสี สีดำสนิท สีน้ำตาลเข้ม หรือสีเหลืองหรือครีมจาง','ขนมีสีครีม สีน้ำตาลเหลือง และ สีดำ','สำหรับสุนัขพันธุ์นี้ ต้องมีคอกที่ใหญ่และมีรั้วสูงล้อมรอบ มีพื้นที่ให้น้องหมาวิ่งเล่นก็จะดี ควรให้เขาออกกำลังกายวันละ 30 นาที จะทำให้พวกเขาแข็งแรง มีความมั่นคงทางอารมณ์ เนื่องจากสุนัขพันธุ์นี้จะอ้วนง่ายเวลาที่มีอายุมากขึ้นซึ่งสามารถก่อให้เกิดปัญหาด้านสุขภาพ ดังนั้นจึงควรดูแลอาหารการกินที่มีปริมาณและคุณค่าทางอาหารเหมาะสมตามวัยของสุนัข ทำความสะอาดเดือนละ 2 ครั้ง','อาบน้ำ 1 ครั้งต่อ 1 เดือน','ควรแปรงขนให้สัปดาห์ละ 1-2 ครั้ง','ควรให้เขาเดินได้วันละ 30 นาที จะทำให้พวกเขาแข็งแรง ในขณะที่สำหรับลูกสุนัข จะใช้เวลาในการเล่นทั้งวัน ใครที่คิดจะเลี้ยง สุนัข ลาบราดอร์ บ้านของคุณควรมีบริเวณสนามหลังบ้าน ไว้ให้พวกเขาได้วิ่งเล่น และพวกเขายังเป็นจอมเคี้ยวและจอมขุดตัวยงอีกด้วย ถ้าคุณอยากให้สวนของคุณสวยเหมือนเดิม ให้เตรียมกั้นรั้วไว้ว่าบริเวณไหนที่คุณจะอนุญาตให้ ลาบราดอร์ เล่นได้','','Medium','Long','Drop','','data:image/jpeg;base64,'),(3,'บีเกิ้ล (Begle)','ต้นกำเนิดของสุนัขสายพันธุ์บีเกิลนั้นไม่เป็นที่แน่ชัด แต่เชื่อกันว่าสุนัขกลุ่ม Hound สายพันธุ์นี้น่าจะมีถิ่นกำเนิดอยู่ในประเทศอังกฤษตั้งแต่ยุคสมัยก่อนที่จักรวรรดิโรมันจะเข้ายึดครอง บางรายงานกล่าวว่ามีการพบสุนัขสายพันธุ์นี้ในสมัยฝรั่งเศสและกรีกโบราณ และมีหลักฐานที่แน่ชัดชิ้นหนึ่งซึ่งบ่งชี้ว่ามีการใช้สุนัขสายพันธุ์บีเกิลนี้สำหรับล่าสัตว์ โดยเฉพาะสัตว์ตัวเล็กๆ อย่างกระต่าย ตั้งแต่ยุคสงครามครูเสด','สุนัขพันธุ์นี้สืบเชื้อสายมาจากสุนัขที่ใช้ในการล่าสัตว์ด้วยเดินเท้าเป็นกลุ่มในอังกฤษ เวลส์และฝรั่งเศส อีกพันธุ์ที่เรียกว่า \"สุนัขพันธุ์บีเกิ้กระเป๋า\" ที่ใช้สำหรับล่าสัตว์บนหลังม้าเพราะสุนัขสูงน้อยกว่า 10 นิ้วและสามารถเก็บในกระเป๋าขนไปเริ่มต้นของการตามล่าได้ บีเกิ้ลเป็นที่รู้จักกันดีที่สุดสำหรับการล่ากระต่ายแม้ว่าสายพันธุ์ยังได้ถูกนำมาใช้ในการล่าสัตว์เป็นความหลากหลายเป็นสกุลวงศ์และหมูป่า แม้ว่าจะยังมีการใช้บีเกิ้ลสำหรับการล่าสัตว์บาง แต่บีเกิ้ลส่วนใหญ่ในวันนี้เป็นสัตว์เลี้ยงในบ้านน่ารัก','บีเกิลเป็นสุนัขที่เป็นมิตร ร่าเริง ไม่ขี้อาย ไม่ขี้กลัว และไม่ก้าวร้าว ต่อคนหรือสัตว์อื่นๆ ด้วยขนาดที่กระทัดรัด และด้วยที่เค้าชอบคน บีเกิลจึงเป็นสุนัขที่เข้ากับเด็กๆได้ดี บีเกิ้ลสามารถปรับตัวเข้ากับคนได้เป็นอย่างดีจนเค้าไม่เหมาะจะเป็นสุนัขกลางแจ้ง การที่ถูกทิ้งไว้หลังบ้านตลอดเวลา จะทำให้เค้าเบื่อซึ่งจะแสดงออกโดย การเห่า หอน ขุด และพยายามหนี้','ความสูงไม่ควรเกิน 15 นิ้ว','หูอยู่ในตำแหน่งต่ำเล็กน้อย ชิดกับหัว ขอบหน้าใบหูชิดกับแก้ม มีความยาวมากถ้ากางหูออก ปลายใบหูจะชิดกับปลายจมูก ใบหูเนื้อบาง หูค่อนข้างกว้างและกลม ในส่วนปลายไม่สามารถทำให้หูตั้งขึ้นได้','ลำตัวสะอาดเต็มไปด้วยกล้ามเนื้อเส้นโค้งของไหล่จะทำให้การเดินและท่าทางของสุนัขเต็มไปด้วยความแข็งแรงดูไม่หนาเทอะทะ','อยู่ตำแหน่งปานกลาง ปลายหางโค้งขึ้นเล็กน้อยสูงกว่า แต่ไม่ไปด้านหน้ามากนัก หางจะมีขนเป็นพวง','ขนสั้น เรียบแน่น','3 สีร่วมกันโดยบนหลังจะเน้นเป็นสีน้ำตาลแดง อกและใต้ท้องจะเป็นสีขาว พาดด้วยสีดำไหม้','การดูแลทำความสะอาดให้สุนัขขนสั้นอย่างบีเกิลนั้นแสนง่าย แค่อาบน้ำให้เค้าอาทิตย์ละครั้งก็เพียงพอ จากนั้นก็เช็ดหรือเป่าตัวของเค้าให้แห้งพร้อมๆ กับแปรงขนไปด้วย หรือถ้าไม่สกปรกมากอาจใช้แค่ผ้าสะอาดชุบน้ำเช็ดตัวให้เค้าก็ได้ ส่วน เรื่องการแปรงขนให้บีเกิลสามารถทำได้โดยง่าย เนื่องจากว่าเค้ามีขนสั้นและสีเข้ม ควรแปรงขนให้แก่น้องบีเกิลทุกๆ 3-4 วัน เพื่อกำจัดเส้นขนที่ตายแล้วออกไปและช่วยเพิ่มความเงางามแข็งแรงแก่เส้นขน','อาบน้ำ 1 ครั้งต่อ 2 สัปดาห์','ควรแปรงขนให้แก่น้องบีเกิลทุกๆ 3-4 วัน เพื่อกำจัดเส้นขนที่ตายแล้วออกไปและช่วยเพิ่มความเงางามแข็งแรงแก่เส้นขน','ควรพาน้องบีเกิลไปออกกำลังกายบ้างอย่างน้อยวันละ 2 ครั้งเช้า-เย็น และหากอาศัยอยู่ในพื้นที่ซึ่งไม่มีบริเวณกว้างขวางนัก อย่างเช่น คอนโดมิเนียม อพาร์ทเมนต์ ก็จะต้องพิจารณาให้ดีว่าพอมีเวลาและมีสวนสาธารณะใกล้เคียงที่สามารถพาเค้าไปเดินเล่นออกกำลังได้หรือไม่','','Small','Short','Drop','','data:image/jpeg;base64,'),(4,'พ็อมโบรค เวล์ช คอร์กี้ (Pembroke Welsh Corgi)','สุนัขสายคอร์กี้สายพันธุ์นี้มีถิ่นกำเนิดอยู่ในรัฐเพ็มโบรคเชียร์ แคล้นเวล์ส ประเทศอังกฤษ ซึ่งเป็นสายพันธุ์เก่าแก่เมื่อ 3,000 ปีก่อน ในช่วงศตวรรษที่ 12 เริ่มด้วยตอนแรกเรียกสุนัขพันธุ์นี้ว่า เวลส์ เคอร์ (Welsh Cur) กระทั่งถึงศตวรรษที่ 19 จึงเปลี่ยนมาเรียกเป็น เวลส์ คอร์กี้ (Welsh Corgi) จนถึงปัจจุบัน โดยในปีค.ศ. 1107 ช่างทอผ้าชาวเฟรมมิช ซึ่งมีรกรากเดิมอาศัยอยู่ในประเทศเบลเยี่ยม ได้นำบรรพบุรุษสายตรงของพ็อมโบรค เวล์ช คอร์กี้ข้ามช่องแคบระหว่างเกาะอังกฤษกับประเทศฝรั่งเศส เข้ามายังแคว้นเวล์ส สุนัขสายพันธุ์นี้ เกิดจากการผสมข้ามพันธุ์หลายพันธุ์คือ คีชอน ,ปอมเมอเรเนียน ซามอยด์ นอร์วีเจียน เอลค์ฮาวนด์ และ ฟินนิช สปิตซ์','จากหลักฐานในคริสต์ศตวรรษที่ 11 มีการกล่าวถึงชื่อสุนัขพันธุ์เวล์ช แคทเทิล (Welsh cattle) ซึ่งถูกนำมาเลี้ยงเป็นสุนัขที่ใช้ทำงานในฟาร์มปศุสัตว์ หรือจะเรียกอีกนัยว่าเป็นบรรพบุรุษของสุนัขพันธุ์เวล์ช คอร์กี้  ในยุคปัจจุบันก็คงไม่ผิดนัก ด้วยเอกลักษณ์ของลำตัวที่ค่อนข้างสั้นแคระ พวกมันจึงมีข้อได้เปรียบเเตกต่างจากสุนัขพันธุ์อื่น ๆ  โดยเฉพาะการทำหน้าที่ต้อนฝูงวัว ที่สามารถหลบจากการถูกดีดหรือเตะได้ เนื่องจากมีช่วงขาที่สั้น คอร์กี้จึงมักวิ่งอยู่ข้างหลังวัว โดยถ้ามีวัววิ่งย้อนกลับมา หรือพยายามเข้าหามัน  คอร์กี้จะกระโดดกัดที่จมูกของวัว เพื่อให้วัวกลับเข้าฝูงไปเหมือนเดิม นอกจากจะใช้คุมฝูงวัวแล้ว เจ้าคอร์กี้ยังสามารถใช้คุมฝูงแกะ และม้าแคระ (Welsh ponies) ได้ หรือจะเลี้ยงไว้เป็นสุนัขเฝ้าบ้านก็เเสนฉลาดเเละน่ารัก','พ็อมโบรค เวล์ช คอร์กี้ดูภายนอกเหมือนห้าวหาญเด็ดเดี่ยว แต่จริงๆ แล้วใจดีมากๆ เชื่อฟังเจ้านายและฝึกง่าย สุภาพอ่อนโยน อยากรู้อยากเห็น มีความกล้าหาญเป็นสุนัขเฝ้ายามที่ดี แต่ไม่ก้าวร้าว ไม่ชอบเห่าพ็อมโบรค เวล์ช คอร์กี้ เป็นมิตรกับคนแปลกหน้า และน้องหมาตัวอื่นๆ ติดเจ้าของ ไม่ว่าจะเจ้าของจะไปไหนก็อยากไปด้วย','ส่วนสูง 10.5–12.5 นิ้ว น้ำหนักควรเหมาะกับขนาด โดยเฉลี่ยแล้วประมาณ 25-38 ปอนด์','ขนาดปานกลาง ตั้งตรง บริเวณยอดสามเหลี่ยมของใบหูต้องโค้งมน','ไล่ตั้งแต่เกราะซี่โครงช่วงอกลงไปถึงโคนหาง ลำตัวมีลักษณะเป็นรูปไข่วงรี อกลึกอยู่ระหว่าง 2 ขาหน้า ช่วงตัวที่อยู่ในระดับต่ำมากนี้เองที่ช่วยให้พวกเขาเคลื่อนไหวได้อย่างมีอิสระ แล้วหางมองจากด้านบน ช่วงท้ายของลำตัวจะคล้ายสิงโต เพียงแต่เป็นสิ่งโตที่ย่อขนาดให้เล็กลงนั่นเอง','หางต้องสั้นโดยไม่ได้รับการตัดแต่ง อันที่จริงแล้วพ็อมโบรค เวล์ช คอร์กี้มีหางบ็อบสั้นหยักศกอยู่แล้วโดยธรรมชาติ แต่ยิ่งสั้นยิ่งดีและได้รับการยอมรับ','มีความยาวปานกลาง หนา แต่จะยาวและหนามากบริเวณรอบๆคอ อก ไหล่ ด้านหลังของขาหน้า และใต้ท้อง ส่วนบริเวณลำตัวขนจะสั้นแบนราบขนาบกับลำตัว อย่างไรก็ตามในช่วงฤดูหนาวจะมีขนอีกชั้นขึ้นหนาใต้ขนชั้นบนที่ยาวกว่าเพื่อให้ความอบอุ่นแก่ร่างกาย','สีขนของพ็อมโบรค เวล์ช คอร์กี้แท้ๆ ดูได้จากขนชั้นบน ซึ่งมีตั้งแต่ขนสีแดง สีน้ำตาลเหลือง น้ำตาลแดง สีขา ไปจนถึงสีดำ แต่บางตัวเอาจะไม่มีขนสีขาวแซมอย่างที่ปกติพวกเขาจะมี ซึ่งตำแหน่งที่ขนสีขาวแซมขึ้นมาจะอยู่บริเวณ ขา คอ ใต้ท้อง และบริเวณสันจมูกระหว่างตาทั้ง 2 ข้าง','พ็อมโบรค เวล์ช คอร์กี้เดิมเป็นสุนัขที่เติบโตในฟาร์ม เขาจึงต้องการการออกกำลังกายเป็นประจำ เช่นเดียวกันกับการแปรงขนเพื่อให้ขนนุ่มสวยเป็นประจำทุกวัน ควรอาบน้ำ 2 ครั้งต่อเดือน ไม่ควรอาบบ่อยเพราะจะทำให้มีปัญหาเรื่องผิวหนัง นอกจากนี้ ควรพาเข้าสังคม ทำความรู้จักคนแปลกหน้า น้องหมาตัวอื่นๆ เพื่อไม่ให้พวกเขารู้สึกหวั่นกลัว เขินอาย ไม่ไว้ใจใคร จนกลายเป็นน้องหมาที่ก้าวร้าวในเวลาต่อมา','อาบน้ำ 1 ครั้งต่อ 2 สัปดาห์','ควรแปรงขนเพื่อให้ขนนุ่มสวยเป็นประจำทุกวัน ','พ็อมโบรค เวล์ช คอร์กี้เดิมเป็นสุนัขที่เติบโตในฟาร์ม เขาจึงต้องการการออกกำลังกายเป็นประจำ',NULL,'Small','Short','Stand',NULL,'https://image.dogilike.com/shareimg/dogthumb_breed/10012_con'),(5,'ชิบะ อินุ (Shiba Inu)','ชิบะ อินุ มีต้นกำเนิดสายพันธุ์มาจากสุนัขล่าสัตว์ที่เติบโตอยู่ในบริเวณภูเขาของประเทศญี่ปุ่น ถือว่า เป็นสุนัขพื้นเมืองของชาวญี่ปุ่น เลี้ยงไว้ล่าสัตว์เล็กๆ คำว่า “ชิบะ” หมายถึงพุ่มไม้หนา “อินุ” หมายถึง สุนัข ชิบะ อินุเป็นสุนัขที่ได้รับมาตรฐานสายพันธุ์แรกของญี่ปุ่น และได้รับการยอมรับและตั้งเป็นอนุสาวรีย์ของญี่ปุ่นผ่านกฎหมายทางทรัพย์สินทางวัฒนธรรม เพื่อการอนุรักษ์ของสุนัขญี่ปุ่น ชิบะ อินุเคยเกือบจะสูญพันธุ์เมื่อช่วงสงครามโลกครั้งที่ 2 ผลมาจากระเบิด สารเคมีและเชื้อโรค แต่หลังจากสงครามได้มีการนำชิบะ อินุที่เหลืออยู่ 3 สายเลือดคือ ชินชุ ชิบะ จากจังหวัดนากาโน่ มิโน ชิบะ จากจังหวัดไอจิ และ ซานอิน ชิบะ จากจังหวัดทตโตะริและจังหวัดชินามิ มาผสมพันธุ์และพัฒนาสายพันธุ์มาเป็นที่รู้จักจนถึงทุกวันนี้','เดิมทีชิบะอินุได้รับการอบรมให้ล่าสัตว์ขนาดเล็ก เช่น นก และกระต่าย แม้จะมีความพยายามที่จะรักษาพันธุ์ไว้ก็ตาม ชิบะเกือบจะสูญพันธุ์ไปในช่วงสงครามโลกครั้งที่สอง เนื่องจากการขาดแคลนอาหารและการระบาดของโรคไข้หัดสุนัขหลังสงคราม สุนัขที่ตามมาทั้งหมดได้รับการผสมพันธุ์จากสายเลือดที่รอดตายเพียงสามสายเท่านั้น คือ ชินชูชิบะ จากจังหวัดนะงะโนะ มิโนะชิบะ จากจังหวัดกิฟุ และซังอิงชิบะ จากจังหวัดทตโตะริและจังหวัดชิมะเนะ','ชิบะ อินุ เป็นสุนัขที่ร่าเริงแจ่มใส คล่องแคล่ว ปราดเปรียว ว่องไว ขี้เล่น ฉลาด รักอิสระซื่อสัตย์ กล้าหาญ ใจดี อ่อนโยน รักและผูกพันกับสมาชิกในครอบครัวมากๆ และเป็นมิตรที่ดีกับเด็กๆ พวกเขาเข้ากับคนแปลกหน้าและสัตว์อื่นๆ ให้เข้ามาร่วมเป็นส่วนหนึ่งได้อย่างดีเยี่ยม ถือได้ว่าเป็นสุนัขที่รักการเข้าสังคมมากที่สุดพันธุ์หนึ่ง แต่ด้วยสายเลือดนักล่า พวกเขาจะไม่ค่อยเป็นมิตรกับหนู หรือกระต่ายเท่าไหร่นัก อย่างไรก็ตามชิบะ อินุ มีข้อเสียก็ตรงค่อนข้างเอาแต่ใจโดยเฉพาะ ขณะฝึกวินัย บางครั้งถึงกับทำให้เจ้าของปวดหัวกับอาการดื้อของพวกเขา ดังนั้นต้องฝึกฝนพวกเขาเป็นประจำอย่างอดทน','ส่วนสูงโดยประมาณ 35-43 cm น้ำหนัก 10 kg เพศเมีย ส่วนสูง โดยประมาณ 33–41 cm น้ำหนัก 8 kg','เป็นทรง 3 เหลี่ยม ตั้งตรง ขนาดเล็กแต่ต้องเป็นสัดส่วนที่พอเหมาะพอดีกับขนาดศีรษะ','แผ่นหลังทรงอยู่ในระดับเดียวกันจนถึงโคนหาง กล้ามเนื้อกระชับกำลังดี ซี่โครงขยายกำลังดี ช่วงท้องกระชับแข็งแรง ช่วงสะโพกแข็งแรง','หางหนา มีพละกำลัง ม้วนตั้งขึ้นบนแผ่นหลังเป็นเหมือนรูปเคียว ความยาวของหางหากปล่อยให้ทิ้งลงกับพื้นจะยาวประมาณช่วงข้อขาที่ต่อมาจากช่วงหน้าขา','เป็นขน 2 ชั้น ขนชั้นนอกจะตรง หยาบ ขนชั้นในเส้นเล็ก นุ่ม และหนาแน่น','สีมาตรฐานจะมี สีแดง สีแดงงา (แดงเกือบดำ) และสีดำกับสีน้ำตาลแทน ส่วนขนชั้นล่างจะเป็นสีครีม สีน้ำตาลอมเทา และสีเทา สีครีมถึงสีขาวสามารถมีแต้มได้ที่บริเวณรอบปาก แก้ม ด้านในหู ใต้คาง ข้างใต้คอบริเวณด้านในขา ด้านในท้อง และด้านในหาง หากเป็นชิบะ อินุสีดำ จะมีสีน้ำตาลแทนหรือน้ำตาลเหลือง แต้มบริเวณรอบปาก เหนือดวงตา ขนในหู หน้าอก ด้านในขาทั้ง 4 ข้าง และด้านในหาง','ชิบะ อินุ เป็นสุนัขขนสั้น หนา ง่ายต่อการดูแลรักษา ผู้เลี้ยงควรแปรงขนให้เขาเป็นประจำ เพื่อแปรงเอาขนที่หลุดล่วงออก ส่วนการอาบน้ำควรอาบให้อย่างน้อย 2-3 สัปดาห์ต่อครั้ง ซึ่งปกติแล้วพวกเขาจะถูกเลี้ยงไว้อยู่ในบ้าน จึงไม่สกปรกมาก การอาบน้ำให้แต่ละครั้งมักมีจุดประสงค์เพื่อชำละล้างชั้นขนที่หลุดล่วงตามฤดูกาล นอกจากขนที่ผู้เลี้ยงต้องดูแลแล้ว ฟันก็ควรได้รับการดูแลให้สะอาดอยู่เสมอ เพื่อให้พวกเขามีฟันไว้บดเคี้ยวอาหารให้ยาวนานที่สุดเท่าที่จะนานได้ ส่วนการดูแลช่องหู ควรใช้น้ำมัน (Baby oil) และสำลีทำความสะอาดอยู่เสมอ เพื่อไม่ให้เกิดการติดเชื้อในช่องหู เป็นสาเหตุของหูอักเสบ หรือเกิดการทำลายหูชั้นใน','อาบน้ำ 1 ครั้งต่อ 2 สัปดาห์','ผู้เลี้ยงควรแปรงขนให้เขาเป็นประจำ เพื่อแปรงเอาขนที่หลุดล่วงออก','ควรพาเขาออกไปเดินหรือวิ่งเล่นเป็นประจำทุกวัน แต่ควรให้ออกกำลังกายอย่างพอเหมาะไม่หักโหมจนเกินไป เพราะโดยปกติแล้วชิบะ อินุเป็นสุนัขที่มีความตื่นตัวอยู่ตลอด สามารถวิ่งเล่น ออกกำลังกายด้วยตัวของมันเอง เพียงแต่การพาไปออกกำลังร่วมกับเจ้าของ เป็นเสมือนการฝึกวินัย และสร้างความผูกพันต่อเจ้าของไปด้วยในตัว','','Medium','Short','Stand','','data:image/jpeg;base64,'),(6,'เซนต์เบอร์นาร์ด (St. Bernard)','ประวัติของยังไม่เป็นที่แน่ชัดในต้นกำเนิดที่แท้จริงใน 700 ปีก่อนคริสตกาล แต่เจ้าเซนต์เบอร์นาร์ดนี้มีความเป็นมาที่ยาวนานมากๆ ตั้งแต่ปี ค.ศ. 1660 – 1670 นับตั้งแต่อดีตจนถึงปัจุบันระยะเวลาประมาณได้กว่า 1,000 ปี ถิ่นกำเนิดของเซนต์เบอร์นาร์ด คือ ประเทศสวิตเซอร์แลนด์ ในบริเวณช่องภูเขาเซนต์เบอร์นาร์ดที่ปกคลุมด้วยหิมะ แห่งเทือกเขาแอลป์(Alps) เป็นสุนัขภูเขาที่มีไว้รักษาความปลอดภัยให้กับพระและช่วยเหลือ กู้ภัยชีวิตมนุษย์ เริ่มต้นในปี ค.ศ. 1048','ผู้เชี่ยวชาญเชื่อว่าสุนัขตัวแรกได้ถูกใช้เพื่อการเฝ้ายาม หลังจากนั้นไม่นานความสามารถในการช่วยชีวิตของเขาก็ปรากฎขึ้น ต่อมาอีก 300 ปีนับจากนั้น เขาได้ช่วยชีวิตคนมากกว่า 2000 คน','เป็นสุนัขที่ใจดีที่สุดในบรรดาเหล่าสุนัขทั้งหลาย(โดยเฉพาะกับเด็กๆ) ฉลาด ไม่ก้าวร้าวและขี้กลัว เป็นมิตรกับคน ถ้าคนไหนไม่รู้จักก็จะต้องแนะนำให้รู้จักก่อนนะ เพื่อมันจะได้ไม่ระแวงคนๆนั้น จริงๆแล้วมันจะได้โชว์ความน่ารักของมันต่างหากล่ะ บางตัวก็จะมีนิสัยเงียบขรึม บางตัวก็จะมีนิสัยร่าเริง บางครั้งอาจร่าเริงเกินเหตุจนอยู่ไม่เป็นสุขอีกด้วย แต่เจ้าเซนต์นี้มันเป็นสุนัขที่ขี้ร้อนเอาการเลยนะ เพราะรูปร่างลักษณะของตัวมันทำให้ต้องมีการระบายความร้อนอยู่เสมอ แต่ถึงจะขี้ร้อนก็เถอะเจ้าเซนต์ยังชอบฝึกฝนและออกกำลังกายอีกด้วย','ตัวผู้สูงอย่างน้อย 27 นิ้ว ตัวเมียสูงอย่างน้อย 25 นิ้ว ตัวเมียจะมีโครงสร้างที่สวยและดูอ่อนช้อยกว่า','มีขนาดปานกลาง จะอยู่สูงจากบริเวณฐาน ห่างจากศีรษะเล็กน้อย แล้วพับงอลงมาด้านข้างแนบกับศีรษะ ใบหูนิ่มมีลักษณะสามเหลี่ยมปลายมนยาวออกไปเล็กน้อยทางด้านปลาย','ลำตัวหน้าใหญ่ มีรูปทรงสี่เหลี่ยม ช่วงซี่โครงอกกว้าง ร่างกายเต็มไปด้วยกล้ามเนื้อ','ใหญ่และยาว มีน้ำหนัก จะอยู่ในลักษณะปลายงอน คล้ายรูปตัว f','ดก หนาแน่น ราบเรียบ มีความยาวพอประมาณ มีขนหยิกเล็กน้อย บริเวณต้นขาขนจะไม่แน่นมาก ที่โคนหางขนจะยาวและแน่นกว่าบริเวณปลายหาง ที่หางขนจะแน่นและหางไม่เป็นรูปธง ควรจะมีส่วนโค้งรับกับลำตัว','ขาวมีแดงแซม หรือ แดงแซมขาว สีแดงก็จะมีหลายเฉดสี สีแดงอมน้ำตาลมีขาวแต้ม สีแดงและเหลืองน้ำตาลมีปริมาณเท่าๆกัน รอยแต้มที่สำคัญ คือ ที่อก เท้าและปลายหาง รอบจมูก รอบๆ คอ เป็นสีขาว สีสันจัดจ้าน ต้องไม่มีแค่สีเดียวหรือไม่มีสีขาว ข้อบกพร่องคือ สีอื่นๆนอกเหนือจากนี้ ยกเว้นเชดสีเข้มบนศีรษะ(หน้ากาก) และหู','อาหารที่ใช้สำหรับเลี้ยง ควรคำนึงถึงสารอาหารไม่ควรเน้นโปรตีนอย่างเดียว ในตอนที่ยังเป็นลูกสุขัขอายุ 4 เดือนควรให้อาหารวันละ 4 ครั้ง เมื่ออายุ 5 เดือนจนถึง 1 ปีลดเหลือ 2 ครั้ง ต่อจากนั้นขึ้นอยู่กับความสะดวกของผู้เลี้ยงในการให้อาหาร อาจลดเหลือ 1 ครั้งต่อวันก็เป็นได้ นอกจากนี้ควรให้น้ำดื่มที่สะอาดด้วย จะต้องมีการเปลี่ยนตลอดเวลาเพราะจะช่วยระบายความร้อนให้กับสุนัข','อาบน้ำ 1 ครั้งต่อ 1 เดือน','แปรงขนทุกครั้งหลังจากอาบน้ำเสร็จ','ควรจะให้สุนัขออกกำลังกายอย่างมีขอบเขต สม่ำเสมอ ไม่ควรหักโหมมากเกินไป เพราะ กระดูกของสุนัขแต่ละวัยจะรับน้ำหนัก แรงกดได้ไม่เหมือนกัน ต้องค่อยๆ ฝึกออกกำลังกายไปตามลำดับ เมื่อสุนัขเติบโตเต็มวัยควรออกกำลังกายแค่พอประมาณเท่านั้น',NULL,'Large','Long','Stand',NULL,'https://imagesvc.meredithcorp.io/v3/mm/image?url=https%3A%2F%2Fstatic.onecms.io%2Fwp-content%2Fuploads%2Fsites%2F47%2F2021%2F07%2F14%2Fsaint-bernard-sitting-in-park-587356629-2000.jpg'),(7,'ไซบีเรียน ฮัสกี (Siberian Husky)','ไซบีเรียน อัสกีนี้มีต้นกำเนิดในตะวันออกของไซบีเรีย คำว่า “ฮัสกี้” ได้มาจากชื่อที่ใช้เรียกชาวอินนูอิต(Inuit) โดยเพาะพันธุ์มากจากสุนัขในวงศ์สปิตซ์(สุนัขขนยาวและหนา)ของชาวชุกซี ต่อมาได้ถุกนำเข้ามาในอลาสกาและแพร่พันธุ์เข้าสู่สหรัฐอเมริกาและประเทศแคนาดา จนพัฒนามาเป็นสุนัขลากเลื่อนเมื่อประมาณ ค.ศ.1900 ต่อมาจึงนำมาไซบีเรียนเลี้ยงเป็นสุนัขตามบ้าน','ป็นสุนัขที่ได้รับความนิยมเลี้ยงในหมู่ชาวชุกชี (Chuckchi) ซึ่งมีถิ่นอยู่อาศัยใกล้กับมหาสมุทรอาร์กติกทางตะวันออกของรัสเซีย โดยพวกเขานำมาเลี้ยงไว้ใช้งานเป็นสุนัขลากเลื่อน สำหรับบรรทุกสิ่งของเเละสัมภาระต่าง ๆ ไปตามเส้นทางที่เต็มไปด้วยหิมะระยะทางไกล ๆ','ไซบีเรียนเป็นสุนัขที่ฉลาด ไฮเปอร์ตื่นตัว พลังงานสูง สมาธิค่อนข้างสั้น รักอิสระ มีความเป็นตัวของตัวเองสูง เข้าขั้นเรียก่า ดื้อ ขี้บ่น ขี้เถียง ฝึกยาก เป็นนักทำลายข้าวของตัวยง แต่ไซบีเรียนเป็นน้องหมาที่เป็นมิตรกับทุกคน ไม่ว่าจะคุ้นหน้า หรือแปลกหน้า ไหวพริบดี ฉลาดแกมโกง ซึ่งไหวพริบกับความฉลาดที่มีของพวกเขานั้นไม่ค่อยได้เอาไปใช้ประโยชน์สักเท่าไหร่ โดยส่วนมากจะเป็นเล่ห์เหลี่ยมเพื่อหาทางซุกซนเสียมากกว่า ไซบีเรียนฮัสกี้ชอบหอนมากกว่าเห่า จนกลายเป็นปัญหาสร้างความเดือดร้อนให้แก่ครอบครัวและเพื่อนบ้าน พวกเขาค่อนข้างฝึกยาก จึงควรได้รับการฝึกอย่างสม่ำเสมอ เป็นประจำทุกวัน วันละ 10 - 15 นาที แต่ควรได้รับการออกกำลังกายเป็นประจำทุกวันมากกว่า 15 นาที โดยการวิ่ง เพื่อให้พวกเขาได้เผาผลาญพลังงาน ไม่ซุกซนจนเกินควร','ความสูงของเพศผู้อยู่ที่ 21 - 23.5 นิ้ว ขณะที่ความสูงของเพศเมียอยู่ที่ 20 - 22 นิ้ว','มีขนาดปานกลาง อยู่ในรูปสามเหลี่ยมส่วนปลายของหูนั้นจะมน ลักษณะเหมือนหูผึ่ง','ความยาวของลำตัวยาวกว่าส่วนสูงเล็กน้อย ช่วงอกลึกเล็กน้อย ซี่โครงขยายกว้าง แต่ด้านข้างจะแบนเล็กน้อย เพื่อการเคลื่อนไหวที่คล่องตัว หลังตรงและแข็งแรง','จะเหมือนพู่เหมือนหางหมาจิ้งจอก รูปโค้งเหนือหลังและลากไปทางด้านหลังเมื่อเคลื่อนไหว','ไซบีเรียนจะมีขน 2 ชั้น มีความยาวปานกลาง โดยขนชั้นในจะนุ่ม ขนชั้นนอกจะตรงเหยียดเรียบไม่หยาบ','มีทุกสีตั้งแต่สีดำไปจนถึงสีขาวล้วน จะมีสีแต้มหรือตำหนิบนศีรษะ และลำตัว','การให้อาหารสุนัขไซบีเรียนนั้น จะให้ 2-3 ครั้ง/วัน ได้ แต่สุนัขพันธุ์นี้จะค่อนข้างกินอะไรยากอยู่เช่นกันหากไม่ถูกปาก มันจะยอมอดอาหารได้ 3-4 วัน ดังนั้นวิธีการที่จะกระตุ้นความอยากอาหารได้คือการพาสุนัขไปออกกำลังกาย ส่วนของอาหารนั้นผู้เลี้ยงสามารถสามารถนำอาหารสำเร็จรูปมาผสมกับอาหารอื่นได้เพื่อเพิ่มรสชาติและอรรถรสในการกินมากขึ้น อาหารที่สุนัขไซบีเรียนโปรดปรานที่สุด คืออาหารที่มีปลาผสมอยู่ในอาหาร สุนัขจะกินหมดได้อย่างรวดเร็ว','อาบน้ำ 1 ครั้งต่อ 2 สัปดาห์','เรื่องของขนสุนัขไซบีเรียนเป็นสิ่งที่สำคัญที่ผู้เลี้ยงควรใส่ใจ หากอยู่ในช่วงฤดูผลัดขนนั้น มันจะมีปริมาณขนที่ผลัดออกมาเยอะมากๆ ฉะนั้นผู้เลี้ยงควรจะต้องมั่นดูแล และแปรงขน เพื่อไม่ให้เกิดขนพันกัน','ควรใช้เวลาการออกกำลังกาย 15 นาที/วัน ดีที่สุดและทำทุกๆวัน','777','Medium','Long','Stand','','https://images-na.ssl-images-amazon.com/images/I/71ARYcac8zL.jpg'),(8,'','','','','','','','','','','','','','','','','','',NULL,'');
